import { createBrowserRouter } from "react-router-dom";
import App from "./App";
import Authentication from './pages/Authentication';
import ProfileStudent from './pages/ProfileStudent'
import EditStudentPage from './pages/EditStudentPage';
import ChooseTeacher from "./pages/ChooseTeacher";
import CreateRequest from "./pages/CreateRequest";
import GenerateApplicaton from "./pages/GenerateApplicaton";
import MethodRecommendations from "./pages/MethodRecommendations";
import FormMarksCompletion from "./pages/FormMarksCompletion";
import ProfileTeacher from "./pages/ProfileTeacher";
import EditTeacherPage from "./pages/EditTeacherPage";
import EditThemeListTeacher from "./pages/EditThemeListTeacher";
import EditSecretaryProfile from "./pages/EditSecretaryProfile";
import ProfileSecretary from "./pages/ProfileSecretary";
import SecretaryTableData from "./pages/SecretaryTableData";


const studentData = {
  surname: 'Едунова',
  name: 'Мария',
  patronymic: 'Алексеевна',
  type_of_user: 'выпускник',
  record_book_number: '032050313',
  group: 'КИ20-12Б',
  average_score: '4.97',
  notification_order: true,
  notification_schedule: true,
  notification_protection: true,
  basis_of_study: 'за счет бюджетных ассигнований федерального бюджета',
  date_of_birth: '29.10.2002',
  year_of_prev_education_completion: 2020,
  form_of_prev_education: 'аттестат о среднем общем образовании',
  year_of_admission: 2020,

  special_marks: '',
  number_of_debts: '',
  certificate_of_curriculum_completion: '',
  record_book_submitted: '', 
  diploma_with_honors: '',
  application_for_postgraduate_leave: '',
  recommended_for_admission: '', 
  
  group_leader: false,
  level_of_education: 'магистратура',
  phone_number: '89131874664',
  email: 'masha.edunova@gmail.com',
  kurs: '4',
  form_of_studying: 'очная',
  access_contacts_agree: true,
  number_of_requests: '0',
  specialtyCode: '09.03.02',
  specialtyName: 'Информационные системы и технологии',
  fieldOfStudyCode: '09.03.02.30',
  fieldOfStudyName:'Информационные системы и технологии',
          


};

const teacherData = {
  surname: 'Раевич',
  name: 'Ксения',
  patronymic: 'Владиславовна',
  type_of_user: 'руководитель',
  phone_number: '89029479572',
  email: 'Kshatrova@sfu-kras.ru',
  job_title: 'доцент',
  academic_title: 'доцент' ,
  academic_degree: 'кандидат технических наук',
  place_of_work: 'кафедра СИИ',
  number_of_vacancies: 5,

};

const secretaryData = {
  surname: 'Герасимова',
  name: 'Екатерина',
  patronymic: 'Ивановна',
  type_of_user: 'секретарь ГЭК',
  phone_number: '89620819991',
  email: 'ket_gerakl@mail.ru',
  job_title: 'старший преподаватель',
  academic_title: 'старший преподаватель' ,
  academic_degree: '-',
  place_of_work: 'кафедра СИИ',
};


const tableData = [
  {
    theme: "Автоматизация госудраственной итоговой аттестации выпускников",
    organization: { name: "всапролд", responsible: "выа", position: "ыа", additional: "ыааонлн" },
    occupied: "да",
    actions: [{ type: "edit"}, { type: "delete"}]
  },
  {
    theme: "Разработка информационной системы сбора и мониторинга данных для зеленой станции СФУ",
    organization: { name: "-", responsible: "-", position: "-", additional: "-" },
    occupied: "нет",
    actions: [{ type: "edit"}, { type: "delete"}]
  },
  {
    theme: "Разработка информационной системы для автошколы СФУ",
    organization: { name: "-", responsible: "-", position: "-", additional: "-" },
    occupied: "нет",
    actions: [{ type: "edit"}, { type: "delete"}]
  },
  {
    theme: "Разработка приложения на основе искусственного интеллекта в сфере создания музыки",
    organization: { name: "-", responsible: "-", position: "-", additional: "-" },
    occupied: "нет",
    actions: [{ type: "edit"}, { type: "delete"}]
  },
];

const requestData = 
  {
    theme_str: 'Разработка клиентской части системы автоматизации ГИА',
    name: 'Едунова Мария Алексеевна',
    group: 'КИ20-12Б',
    rating: '4,97',
    topic: 'Разработка клиентской части системы автоматизации процессов ГИА',
    type: 'комплексная',
    additional: 'Общая тема комплексной ВКР: Разработка системы автоматизации процессов ГИА.Второй участник комплексной ВКР Замыслова Светлана',
  };

 

export const router = createBrowserRouter([
  {
    element: <App />,
    children: [
      { path: "/profile_student", element: <ProfileStudent studentData={studentData} /> },
      { path: "/profile_teacher", element: <ProfileTeacher  teacherData={teacherData} tableData={tableData}/> },
      { path: "/profile_secretary", element: <ProfileSecretary secretaryData={secretaryData} tableData={tableData}/> },
      { path: "/edit_student_profile", element: <EditStudentPage studentData={studentData}/> },
      { path: "/edit_teacher_profile", element: <EditTeacherPage teacherData={teacherData}/> },
      { path: "/edit_secretary_profile", element: <EditSecretaryProfile secretaryData={secretaryData}/> },
      { path: "/", element: <Authentication /> },
      { path: "/choose_teacher", element: <ChooseTeacher studentData={studentData}/> },
      { path: "/create_request", element: <CreateRequest studentData={studentData}/> },
      { path: "/generate_application", element: <GenerateApplicaton studentData={studentData} teacherData={teacherData} requestData={requestData}/> },
      { path: "/method_recommendations", element: <MethodRecommendations /> },
      { path: "/form_marks_completion", element: <FormMarksCompletion studentData={studentData} /> },
      { path: "/edit_theme_list_teacher", element: <EditThemeListTeacher teacherData={teacherData} tableData={tableData}/> },
      { path: "/secretary_table_data", element: <SecretaryTableData secretaryData={secretaryData}/> },
    ]
  },
]);
